import { Table } from "react-bootstrap";

export default function TruthTable(props) {
    console.log(props.truthtable);
    let table = props.truthtable.slice();
    let header = table[0];
    let rows = table.splice(0, 1);
    console.log("header:", header);
    console.log(rows);
    return (
        <Table striped bordered hover>
            <thead>
                <TruthRow row={header} />
            </thead>
            <tbody>
                {rows.map((row) => (
                    <TruthRow row={row} />
                ))}
            </tbody>
        </Table>
    );
}

function TruthRow(props) {
    console.log(props.row);
    return (
        <tr>
            {props.row.map((e) => (
                <th>{e}</th>
            ))}
        </tr>
    );
}
